import React from "react";

export default function Home() {
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Forside</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body"></div>
        </div>
      </div>
    </div>
  );
}
